import React from 'react';
import { Col, Container, Row } from 'reactstrap';
import "../styles/home.css"

const Home = () => {
  return (
    <>
      {/* ============ hero section start =========== */}
      <section className='hero-section'>

          <Row>
            <Col lg='12'>
              <div className='hero-background'></div>
              <div className="wave-container">
        <svg
          className="wave"
          viewBox="0 0 1440 278"
          xmlns="http://www.w3.org/2000/svg"
          fill="#fff"
        >
          <g stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
            <path
              d="M0,260.670469 C268,291.980818 533.333333,258.847538 796,161.270627 C1058.66667,63.6937169 1273.33333,9.93684108 1440,0 L1440,278 L0,278 L0,260.670469 Z"
              fill="#fff"
              transform="translate(720, 139) scale(-1, 1) translate(-720, -139)"
            ></path>
          </g>
        </svg>
      </div>
            </Col>
          </Row>

      </section>
      {/* ============ hero section end =========== */}

    </>
  );
};


export default Home;
